import React from "react";

const PrevArrow = (props) => {
  const { className, style, onClick } = props;
  return (
    <div
      className={`slider_control left slider_control_1 ${className}`}
      style={{ ...style, display: "block" }}
      onClick={onClick}
    />
  );
};

const NextArrow = (props) => {
  const { className, style, onClick } = props;
  return (
    <div
      className={`slider_control right slider_control_1 ${className}`}
      style={{ ...style, display: "block" }}
      onClick={onClick}
    />
  );
};

export { PrevArrow, NextArrow };
